    that pay taxes to the City and County of San Francisco. Each registered business
    may have multiple locations and each location is a single row. The Treasurer & Tax
    Collectoru2019s Office collects this data through business registration applications,
    account update/closure forms, and taxpayer filings. The data is collected to help
    enforce the Business and Tax Regulations Code including, but not limited to: Article
    6, Article 12, Article 12-A, and Article 12-A-1. http://sftreasurer.org/registration",nt"license_title":
